import React, { Component, PropTypes } from 'react';

import { Outlet} from 'react-router-dom';
import AdminSidebar from '../dashboard/Sidebar';

class Home extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div>
                <AdminSidebar/>
                <Outlet />
                
            </div>
        );
    }
}

export default Home;
